import React from 'react';
import { BrowserRouter as Router, Link, NavLink , Switch} from 'react-router-dom';
import { Route } from 'react-router-dom/Route';
import Home from "./app/component/Home";
import Root from "./app/component/Root";
import User from "./app/component/User";

import './App.css';

class App extends React.Component {

  render(){
    return (
      <Router>
        <div className="App">
        <Switch>
        <Route path="/" Component={Home}>Home</Route>
        <Route path="/Root" Component={Root}>Root</Route>
        <Route path="/" Component={User}>User</Route>
        </Switch>
      </div>
      </Router>
    );
  }
}

export default App;
